BEGIN
    SET NOCOUNT ON;

    DECLARE @intPointer INT;
    DECLARE @RoleMasterId BIGINT;
    DECLARE @MemberId BIGINT;
    DECLARE @UserName NVARCHAR(250);
    DECLARE @TanentCode NVARCHAR(250);
    DECLARE @PageUrl NVARCHAR(250);
    DECLARE @PageType BIGINT;

    -- Prepare XML document
    EXEC sp_xml_preparedocument @intPointer OUTPUT, @xmlDoc;

    -- Extract parameters from XML using OPENXML
    SELECT 
        @UserName = tmp.UserName,
        @PageType = tmp.PageType,
        @PageUrl = tmp.pageUrl,
        @RoleMasterId = tmp.RoleMasterId,
        @TanentCode = tmp.TanentCode
    FROM OPENXML(@intPointer, '/Json', 2)
    WITH (
        UserName NVARCHAR(250),
        PageType BIGINT,
        pageUrl NVARCHAR(250),
        RoleMasterId BIGINT,
        TanentCode NVARCHAR(250)
    ) tmp;

    -- Clean up XML document
    EXEC sp_xml_removedocument @intPointer;

    -- Fetch UserId and TenantCode
    SELECT TOP 1 
        @MemberId = MemberId,
        @TanentCode = TanentCode
    FROM Members
    WHERE ContactNumber = @UserName OR Email = @UserName;




    -- Determine RoleMasterId or MemberId based on existence in RoleWiseFieldAccess
    IF EXISTS (SELECT 1 FROM RoleWiseFieldAccess WHERE LoginId = @MemberId)
    BEGIN
        SET @RoleMasterId = 0;
    END
    ELSE
    BEGIN
        SET @MemberId = 0;
    END;

    -- Query to generate XML result efficiently
    ;WITH XMLNAMESPACES('http://james.newtonking.com/projects/json' AS json)
    SELECT 
        CAST((SELECT 
            'true' AS [@json:Array],
            pc.ControlName, 
            pc.ResourceKey, 
            ISNULL(rwfa.AccessId, 0) AS AccessId,
            ISNULL(pc.DataSource, '0') AS DataSource,
            rwfa.RoleId,
            rwfa.LoginId,
            p.PageName,
            p.ControllerName AS PageURL,
            ISNULL(pc.IsMandatory, 0) AS IsMandatory,
            ISNULL(pc.ValidationExpression, '-') AS ValidationExpression,
            pc.ControlType
        FROM PageControl pc
         JOIN RoleWiseFieldAccess rwfa 
            ON pc.PageId = rwfa.PageId 
            AND pc.PageControlId = rwfa.PageControlId 
            AND rwfa.IsActive = 1
         JOIN Pages p 
            ON p.PageId = pc.PageId
        WHERE pc.IsActive = 1  and rwfa.IsActive = 1 and p.IsActive = 1 
          AND (rwfa.RoleId = @RoleMasterId AND rwfa.LoginId = @MemberId)
          AND rwfa.TanentCode = @TanentCode
        FOR XML PATH('PageControlList'), ELEMENTS, ROOT('Json')) AS XML) AS Result;
END;

BEGIN SET NOCOUNT ON;
DECLARE @intPointer INT; DECLARE @RoleMasterId BIGINT; DECLARE @CultureId BIGINT; DECLARE @MemberId BIGINT = 0; DECLARE @UserName NVARCHAR(500); DECLARE @TanentCode NVARCHAR(250);
-- Prepare XML document EXEC sp_xml_preparedocument @intPointer OUTPUT, @xmlDoc;
-- Extract UserName and CultureId from XML SELECT @UserName = tmp.[UserName], @CultureId = tmp.[CultureId], @RoleMasterId = tmp.[RoleMasterId], @TanentCode =tmp.[TanentCode] FROM OPENXML(@intPointer, 'Json', 2) WITH ([UserName] NVARCHAR(500), [CultureId] BIGINT , [RoleMasterId] bigint ,[TanentCode] NVARCHAR(250)) tmp;
-- Clean up XML document EXEC sp_xml_removedocument @intPointer;
-- Fetch UserId in a single statement SELECT TOP 1 @MemberId = MemberId, @TanentCode=TanentCode FROM Members WHERE ContactNumber = @UserName or Email=@UserName;
-- Check if user has role-page mapping for specific conditions IF NOT EXISTS ( SELECT 1 FROM RoleWisePageMapping crwpm JOIN Pages p ON crwpm.PageId = p.PageId WHERE crwpm.LoginId = @MemberId AND crwpm.RoleMasterId = @RoleMasterId AND p.IsActive = 1 AND crwpm.IsActive = 1 AND crwpm.TanentCode=@TanentCode ) BEGIN SET @MemberId = 0; END;
WITH XMLNAMESPACES ('http://james.newtonking.com/projects/json' AS json) SELECT CAST(( SELECT 'true' AS [@json:Array], p.[PageId], p.[PageName], p.ResourceKey AS ResourcePageName, p.[ParentPageId], p.[ControllerName], p.[ActionName], p.[IsReport], p.[PageIcon], p.[SequenceNumber], ISNULL(p.[ModuleId], 0) AS [ModuleId], p.[Description], p.[IsPhoneNo], p.[IsReloadForcefully], p.[UserPersonaMasterId], p.[IsHomePageForUserPersona], p.[IsVisibleInMenu], ISNULL(p.IsCommingSoonIndicator, '0') AS [IsCommingSoonIndicator] ,(Cast((SELECT 'true' AS [@json:Array] , cp.[PageId], cp.[PageName], cp.ResourceKey AS ResourcePageName, cp.[ParentPageId], cp.[ControllerName], cp.[ActionName], cp.[IsReport], cp.[PageIcon], ISNULL(cp.[ModuleId], 0) AS [ModuleId], cp.[SequenceNumber], cp.[Description], cp.[IsPhoneNo], cp.[IsReloadForcefully], cp.[UserPersonaMasterId], cp.[IsHomePageForUserPersona], cp.[IsVisibleInMenu], cp.[IsActive], ISNULL(cp.IsCommingSoonIndicator, '0') AS [IsCommingSoonIndicator] FROM Pages cp JOIN RoleWisePageMapping crwpm ON cp.PageId = crwpm.PageId AND crwpm.LoginId = @MemberId WHERE cp.IsActive = 1 AND cp.ParentPageId = p.PageId AND crwpm.RoleMasterId = @RoleMasterId AND crwpm.IsActive = 1 AND crwpm.TanentCode=@TanentCode ORDER BY cp.SequenceNumber ASC FOR XML path('PagesList'),ELEMENTS) AS XML))
FROM Pages p JOIN RoleWisePageMapping rwpm ON p.PageId = rwpm.PageId AND rwpm.LoginId = @MemberId WHERE p.IsActive = 1 AND (p.ParentPageId = 0 OR p.ParentPageId IS NULL) AND ISNULL(p.IsInnerPage, 0) = 0 AND rwpm.RoleMasterId = @RoleMasterId AND rwpm.IsActive = 1 AND rwpm.TanentCode=@TanentCode ORDER BY p.SequenceNumber ASC FOR XML PATH('PagesList'), ELEMENTS, ROOT('Json')) AS XML) END;

BEGIN
    DECLARE @Action NVARCHAR(20), @BillId BIGINT;

    IF EXISTS (SELECT * FROM DELETED)
    BEGIN
        SET @Action = 'DELETE';
        SET @BillId = (SELECT BillId FROM DELETED);
    END
    ELSE
    BEGIN
        SET @Action = 'UPDATE';
        SET @BillId = (SELECT BillId FROM INSERTED);
    END

    INSERT INTO AuditTrail (TableName, Action, RecordId, ActionBy)
    VALUES ('Bills', @Action, @BillId, SYSTEM_USER);
END;

BEGIN DECLARE @AdvertisingBannerId BIGINT; DECLARE @IsUpdate BIT;
BEGIN TRANSACTION;
-- Parse the XML data DECLARE @hDoc INT; EXEC sp_xml_preparedocument @hDoc OUTPUT, @XMLData;
-- Check if AdvertisingBanner exists SELECT @AdvertisingBannerId = AdvertisingBannerId FROM OPENXML(@hDoc, '/Root/AdvertisingBanner', 2) WITH ( AdvertisingBannerId INT ) Banner;
-- Determine whether to update or insert SET @IsUpdate = CASE WHEN ISNULL(@AdvertisingBannerId,0)=0 THEN 0 ELSE 1 END;
-- Update or insert into AdvertisingBanner table IF @IsUpdate = 1 BEGIN UPDATE AdvertisingBanner SET MemberId = Banner.MemberId, BannerName = Banner.BannerName, BannerImage = Banner.BannerImage, FromDate = Banner.FromDate, ToDate = Banner.ToDate, Field1 = Banner.Field1, Field2 = Banner.Field2, Field3 = Banner.Field3, Field4 = Banner.Field4, Field5 = Banner.Field5, Field6 = Banner.Field6, Field7 = Banner.Field7, Field8 = Banner.Field8, Field9 = Banner.Field9, Field10 = Banner.Field10, IsActive = Banner.IsActive, Description = Banner.Description, Title = Banner.Title, Url = Banner.Url, TanentCode = Banner.TanentCode, UpdatedDate = dbo.GetDateLocal(), UpdatedBy = Banner.UpdatedBy
FROM OPENXML(@hDoc, '/Root/AdvertisingBanner', 2) WITH ( AdvertisingBannerId BIGINT, MemberId BIGINT, BannerName NVARCHAR(150), BannerImage NVARCHAR(500), FromDate DATETIME, ToDate DATETIME, Field1 NVARCHAR(50), Field2 NVARCHAR(50), Field3 NVARCHAR(50), Field4 NVARCHAR(50), Field5 NVARCHAR(50), Field6 NVARCHAR(50), Field7 NVARCHAR(50), Field8 NVARCHAR(50), Field9 NVARCHAR(50), Field10 NVARCHAR(50), IsActive BIT, Description NVARCHAR(MAX), Title NVARCHAR(500), Url NVARCHAR(500), TanentCode NVARCHAR(250), UpdatedBy BIGINT ) Banner WHERE AdvertisingBanner.AdvertisingBannerId = @AdvertisingBannerId; END ELSE BEGIN INSERT INTO AdvertisingBanner ( MemberId, BannerName, BannerImage, FromDate, ToDate, Field1, Field2, Field3, Field4, Field5, Field6, Field7, Field8, Field9, Field10, IsActive, Description, Title, Url, TanentCode, CreatedDate, CreatedBy ) SELECT Banner.MemberId, Banner.BannerName, Banner.BannerImage, Banner.FromDate, Banner.ToDate, Banner.Field1, Banner.Field2, Banner.Field3, Banner.Field4, Banner.Field5, Banner.Field6, Banner.Field7, Banner.Field8, Banner.Field9, Banner.Field10, Banner.IsActive, Banner.Description, Banner.Title, Banner.Url, Banner.TanentCode, dbo.GetDateLocal(), Banner.CreatedBy FROM OPENXML(@hDoc, '/Root/AdvertisingBanner', 2) WITH ( MemberId BIGINT, BannerName NVARCHAR(150), BannerImage NVARCHAR(500), FromDate DATETIME, ToDate DATETIME, Field1 NVARCHAR(50), Field2 NVARCHAR(50), Field3 NVARCHAR(50), Field4 NVARCHAR(50), Field5 NVARCHAR(50), Field6 NVARCHAR(50), Field7 NVARCHAR(50), Field8 NVARCHAR(50), Field9 NVARCHAR(50), Field10 NVARCHAR(50), IsActive BIT, Description NVARCHAR(MAX), Title NVARCHAR(500), Url NVARCHAR(500), TanentCode NVARCHAR(250), CreatedDate DATETIME, CreatedBy BIGINT ) Banner;
SET @AdvertisingBannerId = SCOPE_IDENTITY(); END
-- Update or insert into ConfigurableEntity table (multiple times) IF @IsUpdate = 1 BEGIN UPDATE ConfigurableEntity SET Description = Config.Description, State = Config.State, City = Config.City, Pincode = Config.Pincode, RuleId = Config.RuleId, IsActive = Config.IsActive, UpdatedDate = dbo.GetDateLocal(), UpdatedBy = Config.UpdatedBy FROM OPENXML(@hDoc, '/Root/AdvertisingBanner/ConfigurableEntity', 2) WITH (
EntityId BIGINT, EntityObjectType NVARCHAR(250), EntityObjectId bigint, Description NVARCHAR(MAX), State BIGINT, City BIGINT, Pincode NVARCHAR(100), RuleId BIGINT, UpdatedBy BIGINT, IsActive BIT ) Config WHERE ConfigurableEntity.EntityId = Config.EntityId AND ConfigurableEntity.EntityObjectId = @AdvertisingBannerId and ConfigurableEntity.EntityObjectType = Config.EntityObjectType; END ELSE BEGIN INSERT INTO ConfigurableEntity ( EntityObjectType, EntityObjectId, Description, State, City, Pincode, RuleId, IsActive, CreatedDate, CreatedBy, TanentCode ) SELECT EntityObjectType, @AdvertisingBannerId, Description, State, City, Pincode, RuleId, IsActive, dbo.GetDateLocal(), CreatedBy, TanentCode
FROM OPENXML(@hDoc, '/Root/AdvertisingBanner/ConfigurableEntity', 2) WITH ( EntityId BIGINT, EntityObjectType NVARCHAR(250), EntityObjectId BIGINT, Description NVARCHAR(MAX), State BIGINT, City BIGINT, Pincode NVARCHAR(100), RuleId BIGINT, IsActive BIT, CreatedDate DATETIME, CreatedBy BIGINT, TanentCode NVARCHAR(250) ) Config; END
EXEC sp_xml_removedocument @hDoc;
COMMIT TRANSACTION;
SELECT @AdvertisingBannerId AS 'AdvertisingBannerId'; END;

